import React, { useState } from 'react';
import {  Routes , Route , Link } from "react-router-dom";



const Subproject1=()=>{

  return <div>
    subproject
  </div>

}
const Subproject2=()=>{

  return <div>
    subproject2
  </div>

}

export default function Project1() {



  return (
    <div>
     
        <h1>this is zifcare</h1> 
        <Routes>
        <Route  path="web_version"  element={<Subproject1 />} />
        <Route path="app_version"  element={<Subproject2 />} />
        </Routes>
      
<Link to="/project_zifcare/web_version" >click1</Link>
<Link to="/project_zifcare/app_version" >click2</Link>

      
    </div>
  )
}
